-- ----------------------------
-- Table structure for kf_weblist
-- ----------------------------
DROP TABLE IF EXISTS `kf_weblist`;
CREATE TABLE `kf_weblist` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `web_name` varchar(30) DEFAULT NULL COMMENT '网站名称',
  `url` varchar(30) DEFAULT NULL COMMENT '网站域名-或者熊掌号名称',
  `create_time` int(10) DEFAULT NULL COMMENT '创建时间',
  `userid` int(10) DEFAULT NULL COMMENT '用户ID',
  `userpid` int(10) DEFAULT NULL COMMENT '用户父ID',
  `bake_name` varchar(50) DEFAULT '' COMMENT '网站后台地址',
  `bake_username` varchar(30) DEFAULT '' COMMENT '后台账号',
  `base_pass` varchar(32) DEFAULT NULL COMMENT '后台密码',
  `ftp_addr` varchar(30) DEFAULT NULL COMMENT 'ftp地址',
  `ftp_username` varchar(30) DEFAULT NULL COMMENT 'FTP账号',
  `ftp_pass` varchar(32) DEFAULT NULL COMMENT 'FTP密码',
  `beizhu` varchar(30) DEFAULT NULL COMMENT '备注信息',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态',
  `delweb` tinyint(1) DEFAULT '1' COMMENT '删除网站1是正常,0是删除网站代理审核,-1是管理员审核,同意之后就删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `urlkey` (`url`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=175 DEFAULT CHARSET=utf8 COMMENT='网站列表';

